import { BrowserRouter, Route, Routes } from "react-router-dom"
import Coin from "./Coin";
import Coins from "./Coins";

function Router() {
    return (
        <>
            <Routes>
                <Route path="/" element={<Coins />}></Route>
                <Route path="/:coinId" element={<Coin />}></Route>
            </Routes>
        </>
    )
}

export default Router;
